> Top News Premiums expected to rise in many health law markets The HealthCare.gov website, where people can buy health insurance, is displayed on a laptop screen in Washington, Tuesday, Oct. 6, 2015. Premiums are expected to rise in many parts of the country as a new sign-up season under President Barack Obama’s health care law starts Nov. 1. But consumers have options if they’re willing to shop, and an upgraded government website will help them compare. (AP Photo/Andrew Harnik) 
